import { Header } from "./components/header";
import { Navigation } from "./components/navigation";
import { TrainingCourses } from "./components/trainingCourses";
import { Flex } from "./defaultStyles";

function App() {
  return (
    <div className="App">
      <Header />
      <Flex>
        <Navigation />
        <TrainingCourses />
      </Flex>
    </div>
  );
}

export default App;
